import React from 'react'

const ChaptersList=(props)=>{
    return(
        <li key={props.chapter} style={{listStyle:'none'}}  onClick={()=>{if(document.getElementById(props.chapter).checked) console.log(document.getElementById(props.chapter).value);}}>
        <input type="checkbox" id={props.chapter} name={props.chapter} value={props.chapter}/>
        <label htmlFor="ChapterX1"> {props.chapter} </label><br/>
        </li>
    );
}

export default ChaptersList;
